description:
Verenigde Staten
Actie / Sciencefiction
89 minuten

goed

met Emile Hirsch, Rachael Taylor en Max Minghella

Buitenaardse wezens zijn geland op aarde en hebben het complete elektriciteitsnet op de planeet platgelegd. Hierdoor is de 
mensheid niet in staat om zich te organiseren en terug te vechten. De buitenaardse wezens jagen systematisch op het 
ongeorganiseerde, hopeloze leger. Ondertussen probeert een kleine groep Amerikaanse toeristen in Moskou hun krachten te 
bundelen, in een poging de indringers te stoppen, voordat de volledige mensheid is uitgeroeid.
